import React, { Component } from "react";
//导入组件
import Hello from "./components/Hello/Hello";
import Welcome from "./components/Welcome/Welcome";

//创建外壳组件
class App extends Component {
  render() {
    return (
      <div>
        <Hello />
        <Welcome />
      </div>
    );
  }
}

export default App;
